import React from 'react';
import yourLogoImage from '../images/your-logo.png'; // Importing your logo image
import facebookIcon from '../images/fb.png'; // Importing Facebook icon
import instagramIcon from '../images/instagram-icon.png'; // Importing Instagram icon

function Header() {
  return (
    <header>
      <div className="logo">
        <img src={yourLogoImage} alt="Your Logo" />
      </div>
      <div className="social-icons">
        <img src={facebookIcon} alt="Facebook" />
        <img src={instagramIcon} alt="Instagram" />
      </div>
    </header>
  );
}

export default Header;
